alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
# for (i=0, checksum=0; i<N; i++){
# 	for (j=0; j<N; j++){
# 		for (k=0, sum=0; k<N; k++)
# 			sum+= A[i][k]*B[j][k];
# 		aux = alpha*sum + beta*C[i][j];
# 		checksum += aux;
# 		C[i][j] = aux;
# 	}
# }

        la   s0,a
        la   s1,b
        la   s2,c
        lw   s3,N
        lw   s4,alpha
        lw   s5,beta
        
        # for (i=0, checksum=0; i<N; ...)
        mv   t0,zero        # t0 <-> i
        mv   s6,zero        # s6 <-> checksum
        bge  t0,s3,endfor_i

loopfor_i:
        # for (j=0; j<N; ...)
        mv   t1,zero        # t1 <-> j
        bge  t1,s3,endfor_j
        
loopfor_j:
        # for (k=0, sum=0; k<N; ...)
        mv   t2,zero        # t2 <-> k
        mv   s7,zero        # s7 <-> sum
        bge  t2,s3,endfor_k
loopfor_k:
        # sum+= A[i][k]*B[j][k];
        mul  t3,t0,s3       # i*N (words)
        add  t3,t3,t2       # i*N+k (words)
        slli t3,t3,2        # (i*N+k)*4 (bytes)
        add  t3,t3,s0       # t3=&(A[i][k])
        lw   t3,0(t3)       # t3=A[i][k]

        mul  t4,t1,s3       # j*N (words)
        add  t4,t4,t2       # j*N+k (words)
        slli t4,t4,2        # (j*N+k)*4 (bytes)
        add  t4,t4,s1       # t4=&(B[j][k])
        lw   t4,0(t4)       # t4=B[j][k]
        
        mul  t3,t3,t4
        add  s7,s7,t3       # sum += A[i][k]*B[j][k]

        # for (...;...;k++)
        addi t2,t2,1
        blt  t2,s3,loopfor_k
endfor_k:
        # aux = alpha*sum + beta*C[i][j];
        # checksum += aux;
        # C[i][j] = aux;
        mul  t3,t0,s3       # i*N (words)
        add  t3,t3,t1       # i*N+j (words)
        slli t3,t3,2        # (i*N+j)*4 (bytes)
        add  t3,t3,s2       # t3=&(C[i][j])
        lw   t4,0(t3)       # t4=C[i][j]
        
        mul  s7,s4,s7       # alpha*sum
        mul  t4,s5,t4       # beta*C[i][j]
        add  t4,t4,s7       # aux/t4 = alpha*sum + beta*C[i][j]
        sw   t4,0(t3)       # C[i][j] = alpha*sum + beta*C[i][j]
        add  s6,s6,t4       # checksum += aux;
    
        # for (...;...;j++)
        addi t1,t1,1
        blt  t1,s3,loopfor_j

endfor_j:
        # for (...;...;i++)
        addi t0,t0,1
        blt  t0,s3,loopfor_i
        
endfor_i:
        mv a0,s6
        li a7, 1
        ecall